'The gray fields are fixed, and they are always present. You cannot configure them.<br/>You can use up to 25 custom fields to get the information from your affiliate. Just click on the name, type or status to change the field attributes.'=>'Los campos grises son fijos, y siempre están presentes. No se pueden configurar. <br/> Puede utilizar hasta 25 campos personalizados para obtener la información de su afiliación. Simplemente haga clic en el nombre, tipo o el estado para cambiar los atributos de campo.',
'Affiliate Panel menu & screens'=>'Panel de afiliados y pantallas de menú',
'You have full control over the look of your affiliate panel - you can customize the menu, and even add your static custom pages.'=>'Usted tiene control total sobre el aspecto de su panel de afiliado - usted puede personalizar el menú, e incluso añadir sus páginas personalizadas.',
'General configuration of your signup form. Write the Terms & Conditions of your affiliate program, choose if to display payout option and what to do after signup.'=>'Configuración general de su formulario de registro. Escriba los Términos y Condiciones de su programa de afiliados , elegir si mostrar la opción de pago y qué hacer despues del registro.',
'Customize design of affiliate panel'=>'Personalizar el diseño del panel de afiliados',
'Here you can change design of affiliate panel by changing it\'s templates.'=>'Aquí puede cambiar el diseño del panel de afiliados cambiándo las plantillas.',
'Fixed cost:'=>'Costo fijo:',
'HTML Signup Form'=>'Formulario de Registro HTML',
'If you don\'t want to use the standard signup form, you can use pure HTML signup form. Just copy & paste the code below to a HTML page and you have fully customizable signup form.'=>'Si no desea utilizar el formulario de registro estándar, puede utilizar el formulario de registro HTML puro. Sólo tienes que copiar y pegar el siguiente código para una página HTML y tienes formulario de registro totalmente personalizable.',
'Debugging can be used for troubleshooting. If you turn it on, the system will log every action to your History log. You can use these messages to investigate the flow of commands, and to find out what is wrong. This way you can check what are the scripts doing and where exactly they fail. In production it should be turned off, because it generates multiple history records for each transaction and slows down the system.'=>'Depuración se puede utilizar para solucionar problemas. Si lo enciende, el sistema registrará cada acción para su registro de la Historia. Puede utilizar estos mensajes para investigar el flujo de órdenes, y para averiguar lo que está mal. De esta manera usted puede comprobar ¿cuáles son las secuencias de comandos haciendo y dónde exactamente de que fallen. En la producción se debe dar vuelta apagado, porque genera varios registros de historia para cada transacción y ralentiza el sistema.',
'You can automatically send email about payment to the affiliates.<br/>The email is generated using the \'On affiliate payout\' template.'=>'Usted puede enviar por correo electrónico sobre el pago a los afiliados. <br/> El correo electrónico se genera a través de la plantilla \'Plantilla de Afiliados\'.',
