'Action commissions'=>'Comisiones de Accion',
'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Acción Comisiones le permite definir por acción, o por "anything".<br/>De esta manera se pueden definir las comisiones, por ejemplo, por usuario registrado, por descarga, por visitar la página específica, etc.<br/><a href="%s" target="_blank">Más detalles en nuestra Base de Conocimiento</a>',
'More help in our Knowledge Base'=>'Más detalles en nuestra Base de Conocimiento',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Rotador Banner es un tipo especial de banner que rota otros banners. <br/> Cuando inserta rotador afiliado a su página, se muestra el banner rotatorio que se asignan a los rotadores, por lo que el visitante verá otra bandera cada vez que visita la página de Afiliados.<br/><a href="%s" target="_blank">Más detalles en nuestra Base de Conocimiento</a>',
'Branding free'=>'Branding free',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Branding Free es una característica especial que le permite cambiar los enlaces en el pie de los paneles y formulario de registro de "Powered by %s" a su propio texto y enlace.<br/><a href="%s" target="_blank">Más detalles en nuestra Base de Conocimiento</a>',
'Commission Groups'=>'Commission Groups',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">Mas ayuda en el Knowledge Base</a>',
'CPM commissions'=>'Comisiones CPM',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'CPM (coste por mil) las comisiones son un tipo especial de comisiones que son recompensados por 1000 impresiones, lo que significa para exhibir sus pancartas 1000 veces. <br/><a href="%s" target="_blank">Más detalles en nuestra Base de Conocimiento.</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Matriz forzada le permite limitar el número de remisiones de subaffiliates cualquier afiliado puede consultar. Esto significa que cada afiliado puede tener sólo un número especificado de los niños. <a href="%s" target="_blank">Más detalles en nuestra Base de Conocimiento.</a>',
'Hosting of %s on  %s servers.'=>'Hosting de %s en servidores de  %s.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Múltiples monedas permiten hacer un seguimiento de las ventas en múltiples divisas.<br/><a href="%s" target="_blank">Más detalles en nuestra Base de Conocimiento.</a>',
'Multiple merchants'=>'Multiples Afiliados-Padres',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Por defecto, todas las campañas de% s son públicas, lo que significa que todos los afiliados pueden ver y promoverlos. Función de campañas Privadas le permite crear campañas privados, que será visible sólo a los afiliados seleccionado.<br/><a href="%s" target="_blank">Más detalles en nuestra Base de Conocimiento.</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Puedes crear un e-libro en PDf para los afiliados y no hay necesidad de ejecutar cualquier programa de Windows para la marca, simplemente se descarga en PDF renombrados. Toda la renovación de marca se hace automáticamente en segundo plano.<br/><a href="%s" target="_blank">%s</a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Comisiones Residuales permiten hacer un seguimiento de las ventas en múltiples divisass, como para membrecias. <br/><a href="%s" target="_blank">Más detalles en nuestra Base de Conocimiento.</a>',
