'It is possible to use following values in ID: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be copied to refid as you will specify in format. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'It is possible to use following values in ID: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], todos los demás caracteres seran copiados al refid comi digas con el formato. Ejemplo de buen formato es, por ejemplo {ZZZ}-{XXXXX}-{999}',
'Refid format saved'=>'Refid format saved',
'Refid must be in format "%s". Format definition: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be unchanged. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Refid debe estar en formato "%s". Definicion de formato: {9} - sera reemplazado por cualquier carácter en el rango [0-9], {z} - sera reemplazado por cualquier carácter en el rango [a-z], {Z} - sera reemplazado por cualquier carácter en el rango [A-Z], {X} - sera reemplazado por cualquier carácter en el rango [0-9a-zA-Z], todos los demás caracteres no se modificará. Ejemplo de buen formato es, por ejemplo {ZZZ}-{XXXXX}-{999}',
